"use strict";
var InfoService = (function () {
    function InfoService($versionsService, $logger) {
        this.$versionsService = $versionsService;
        this.$logger = $logger;
    }
    InfoService.prototype.printComponentsInfo = function () {
        var _this = this;
        return (function () {
            var allComponentsInfo = _this.$versionsService.getAllComponentsVersions().wait();
            var table = _this.$versionsService.createTableWithVersionsInformation(allComponentsInfo);
            _this.$logger.out("All NativeScript components versions information");
            _this.$logger.out(table.toString());
        }).future()();
    };
    return InfoService;
}());
exports.InfoService = InfoService;
$injector.register("infoService", InfoService);
